import React from "react";
import { Route, Switch, Link, NavLink } from "react-router-dom";

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavLink to="/">
          <h1>Logo</h1>
        </NavLink>
      </Nav>
    </>
  );
};

export default Navbar;
